        "ledi-documentacao-estrutura-arquivos-dicionario-fad": {
          "title" : "Ficha de Atendimento Domiciliar",
          "content": "FichaAtendimentoDomiciliarMaster\n\n#1 uuidFicha\n\nCódigo UUID para identificar a ficha na base de dados nacional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n36\n44\n\n\n\nRegras: É recomendado concatenar o CNES na frente do UUID, de modo que os 7 dígitos (CNES) + 1 de hífen somados aos 36 (32 caracteres + 4 hífen) do UUID são a limitação de 44 bytes do campo.\n\nReferências: Formato canônico.    Para ver a referência sobre o UUID, acesse: UUID Wikipedia.\n\n#2 tpCdsOrigem\n\nTipo de origem dos dados do registro.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nInteger\nSim\n1\n1\n\n\n\nObservações: Utilizar valor 3 (sistemas terceiros).\n\n#3 atendimentosDomiciliares\n\nLista dos atendimentos realizados pelo profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;FichaAtendimentoDomiciliarChild&amp;gt;\nSim\n0\n99\n\n\n\nReferências: FichaAtendimentoDomiciliarChild.\n\n#4 headerTransport\n\nProfissionais que realizaram o atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nVariasLotacoesHeader\nSim\n-\n-\n\n\n\nRegras: Somente as CBOs apresentadas na Tabela 10 - CBOs que podem registrar ficha de atendimento domiciliar podem ser adicionadas no campo CBO do profissional principal.\n\nReferências: VariasLotacoesHeader.\n\nFichaAtendimentoDomiciliarChild\n\n#1 turno\n\nCódigo do turno onde aconteceu o atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: Turno.\n\n#2 cnsCidadao\n\nCNS do cidadão que recebeu atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n15\n15\n\n\n\nRegras: Validado pelo algoritmo.\n\nReferências: O algoritmo de validação está presente em Validar CNS.\n\n#3 dataNascimento\n\nData de nascimento do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras: Não pode ser posterior a dataAtendimento e anterior a 130 anos a partir da dataAtendimento.\n\nReferências: A data deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos . Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\n#4 sexo\n\nCódigo do sexo do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências:   Sexo.\n\n#5 localDeAtendimento\n\nCódigo do local onde o atendimento foi realizado.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: LocalDeAtendimento.\n\n#6 atencaoDomiciliarModalidade\n\nCódigo da modalidade AD do cidadão atendido.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras:\n\n\nApenas as opções 1, 2 e 3 são aceitas.\nNão pode ser preenchido se o campo tipoAtendimento = 9 - Visita domiciliar pós-óbito.\n\n\nReferências: ModalidadeAD.\n\n#7 tipoAtendimento\n\nCódigo do tipo de atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras: Apenas as opções 7, 8 ou 9 são aceitas.\n\nReferências: TipoDeAtendimento.\n\n#8 condicoesAvaliadas\n\nCondições avaliadas do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;Long&amp;gt;\nNão\n0\n24\n\n\n\nRegras: Não pode ser preenchido se o campo tipoAtendimento = 9 - Visita domiciliar pós-óbito.\n\nReferências: Condições Avaliadas.\n\n#9 cid\n\nCódigo do CID10 registrado no atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n-\n-\n\n\n\n#10    ciap\n\nCódigo do CIAP2 registrado no atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n-\n-\n\n\n\n\nDevem ser apresentados somente os CIAP&amp;#39;s listados em Lista condições avaliadas, cujo código inicia com letra seguida de número.\n\n\n#11    procedimentos\n\nCódigo dos procedimentos registrados no atendimento disponíveis na ficha.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;String&amp;gt;\nNão\n0\n20\n\n\n\nRegras: Não pode ser preenchido se o campo tipoAtendimento = 9 - Visita domiciliar pós-óbito.\n\nReferências: Procedimentos da Atenção Domiciliar.\n\n#12    outrosProcedimentos\n\nCódigo dos procedimentos SIGTAP registrados no atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;String&amp;gt;\nNão\n-\n-\n\n\n\nRegras:\n\n\nSó é permitido inserir procedimentos cujo grupo é igual a 01 - Ações de promoção e prevenção em saúde, 02 - Procedimentos com finalidade diagnóstica, 03 - Procedimentos clínicos ou 04 - Procedimentos cirúrgicos.\nNão podem ser iguais aos procedimentos da tabela Procedimentos da Atenção Domiciliar e nem ao procedimento 0301050104 - Visita domiciliar pós-óbito.\nNão podem haver procedimentos com o mesmo código.\n\n\nReferências: Tabela do SIGTAP, competência 02/2019 disponível em: Tabela unificada SIGTAP.\n\nObservação: Inserir o código do procedimento sem ponto ou hífen, ex: 0201010010.\n\n#13    condutaDesfecho\n\nCódigo do desfecho do atendimento do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: CondutaDesfecho.\n\nCondições avaliadas\n\n\n\nNome\nCódigo\n\n\n\nAcamado\n1\n\n\nDomiciliado\n2\n\n\nÚlceras / Feridas (grau III ou IV)\n3\n\n\nAcompanhamento nutricional\n4\n\n\nUso de sonda naso-gástrica - SNG\n5\n\n\nUso de sonda naso-enteral - SNE\n6\n\n\nUso de gastrostomia\n7\n\n\nUso de colostomia\n8\n\n\nUso de cistostomia\n9\n\n\nUso de sonda vesical de demora - SVD\n10\n\n\nAcompanhamento pré-operatório\n11\n\n\nAcompanhamento pós-operatório\n12\n\n\nAdaptação ao uso de órtese / prótese\n13\n\n\nReabilitação domiciliar\n14\n\n\nCuidados paliativos oncológico\n15\n\n\nCuidados paliativos não-oncológico\n16\n\n\nOxigenoterapia domiciliar\n17\n\n\nUso de traqueostomia\n18\n\n\nUso de aspirador de vias aéreas para higiene brônquica\n19\n\n\nSuporte ventilatório não invasivo - CPAP\n20\n\n\nSuporte ventilatório não invasivo - BiPAP\n21\n\n\nDiálise peritonial\n22\n\n\nParacentese\n23\n\n\nMedicação parenteral\n24\n\n\n\nProcedimentos da Atenção Domiciliar\n\n\n\nCódigo SIGTAP *\nDescrição\n\n\n\n0301070024\nAcompanhamento de paciente em reabilitação em comunicação alternativa\n\n\n0301050082\nAntibioticoterapia parenteral\n\n\n0301070075\nAtendimento / Acompanhamento de paciente em reabilitação do desenvolvimento neuropsicomotor\n\n\n0302040021\nAtendimento fisioterapêutico em paciente com transtorno respiratório sem complicações sistêmicas\n\n\n0301050090\nAtendimento médico com finalidade de atestar óbito\n\n\n0301070067\nAtendimento / Acompanhamento em reabilitação nas múltiplas deficiências\n\n\n0301100047\nCateterismo vesical de alívio\n\n\n0301100055\nCateterismo vesical de demora\n\n\n0201020041\nColeta de material para exame laboratorial\n\n\n0301100063\nCuidados com estomas\n\n\n0301100071\nCuidados com traqueostomia\n\n\n0301100098\nEnema\n\n\n0301100144\nOxigenoterapia\n\n\n0301100152\nRetirada de pontos de cirurgias básicas (por paciente)\n\n\n0301100179\nSondagem gástrica\n\n\n0301100187\nTerapia de reidratação oral\n\n\n0301050120\nTerapia de reidratação parenteral\n\n\n0301070113\nTerapia fonoaudiológica individual\n\n\n0308010019\nTratamento de traumatismos de localização especificada / não especificada\n\n\n0303190019\nTratamento em reabilitação\n\n\n\n* Procedimentos pertencentes a competência 04/2018 do SIGTAP.\n",
          "url": "/ledi/documentacao/estrutura_arquivos/dicionario-fad.html"
        }
        
