        "ledi-documentacao-estrutura-arquivos-dicionario-fv": {
          "title" : "Ficha de Vacinação",
          "content": "FichaVacinacaoMaster\n\n#1 uuidFicha\n\nCódigo UUID para identificar a ficha na base de dados nacional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n36\n44\n\n\n\nRegras: É recomendado concatenar o CNES na frente do UUID, de modo que os 7 dígitos (CNES) + 1 de hífen somados aos 36 (32 caracteres + 4 hífen) do UUID são a limitação de 44 bytes do campo. Formato canônico.\n\nReferências: Para ver a referência sobre o UUID, acesse UUID Wikipedia.\n\n#2 tpCdsOrigem\n\nTipo de origem dos dados do registro.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nInteger\nSim\n1\n1\n\n\n\nRegras: Utilizar valor 3 (sistemas terceiros).\n\n#3 headerTransport\n\nProfissional que realizou a vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nUnicaLotacaoHeader\nSim\n-\n-\n\n\n\nRegras: Somente as CBOs apresentadas na Tabela 12 - CBOs que podem registrar ficha de vacinação podem ser adicionadas no campo CBO do profissional.\nReferências: UnicaLotacaoHeader.\n\n#4 vacinacoes\n\nLista de registros de Vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;FichaVacinacaoChild&amp;gt;\nSim\n1\n99\n\n\n\nReferências: FichaVacinacaoChild.\n\nFichaVacinacaoChild\n\n#1 turno\n\nCódigo do turno onde aconteceu o atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: Turno.\n\n#2 numProntuario\n\nNúmero do prontuário do cidadão na UBS.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n0\n30\n\n\n\n#3 cnsCidadao\n\nCNS do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n15\n15\n\n\n\nRegras: Validado por algoritmo.\n\nReferências: O algoritmo de validação está presente em Validar CNS.\n\n#4 dtNascimento\n\nData de nascimento do cidadão no formato epoch time.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras: Não pode ser posterior à dataAtendimento e anterior à 130 anos a partir da dataAtendimento.\n\nReferências: A data deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos . Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\n#5 sexo\n\nCódigo do sexo do cidadão.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: Sexo.\n\n#6 localAtendimento\n\nCódigo do local onde o atendimento foi realizado.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras: Apenas valores de 1 a 10.\n\nReferências: LocalDeAtendimento.\n\n#7 viajante\n\nMarcador que indica se o cidadão é viajante.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nBoolean\nSim\n-\n-\n\n\n\n#8 comunicanteHanseniase\n\nMarcador que indica se o cidadão é comunicante de hanseníese.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nBoolean\nNão\n-\n-\n\n\n\nRegras: \n\n\nO campo somente pode ser preenchido se for registrada uma vacinação com o imunobiológico 15 - BCG; \nO campo é de preenchimento obrigatório quando for registrada uma vacinação com o imunobiológico 15 - BCG.\n\n\n#9 gestante\n\nMarcador que indica se a cidadã está gestante.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nBoolean\nSim\n-\n-\n\n\n\nRegras: Não pode ser preenchido ser for marcado o campo puerpera.\n\n#10 puerpera\n\nMarcador que indica se a cidadã está puérpera.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nBoolean\nSim\n-\n-\n\n\n\nRegras: Não pode ser preenchido ser for marcado o campo gestante.\n\n#11 vacinas\n\nRegistro das vacinas aplicadas.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nList&amp;lt;VacinaRowThrift&amp;gt;\nSim\n1\n99\n\n\n\nReferências: VacinaRowThrift.\n\nRegras: Deve estar de acordo com os relacionamentos de Imunobiológico x Estratégia x Dose definidos na tabela Regras de vacinação.\n\n#12 dataHoraInicialAtendimento\n\nData e hora do início do atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras:\n\n\nNão pode ser anterior à dataAtendimento;\nNão pode ser posterior à dataHoraFinalAtendimento e à data atual.\n\n\nReferências: Deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos. Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\n#13 dataHoraFinalAtendimento\n\nData e hora do fim do atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras:\n\n\nNão pode ser anterior à dataHoraInicialAtendimento;\nNão pode ser posterior à data atual.\n\n\nReferências: Deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos. Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\nVacinaRowThrift\n\n#1 imunobiologico\n\nCódigo do imunobiológico aplicado na vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: Imunobiologico.\n\n#2 estrategiaVacinacao\n\nCódigo da estratégia da vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: EstrategiaVacinacao.\n\n#3 dose\n\nCódigo da dose do imunobiológico aplicado na vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: Dose.\n\n#4 lote\n\nValor do lote do imunobiológico aplicado na vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n1\n30\n\n\n\nRegras: Apenas letras, números, /, . e -.\n\n#5 fabricante\n\nNome do fabricante do imunobiológico aplicado na vacinação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n1\n60\n\n\n\nRegras: Apenas letras, números, /, ., espaço simples e -.\n",
          "url": "/ledi/documentacao/estrutura_arquivos/dicionario-fv.html"
        }
        
