        "ledi-documentacao-regras-validar-nome": {
          "title" : "Validar nome",
          "content": "Essas regras foram baseadas nas regras oficiais definidas pelo CADSUS na Especificação Técnica para integração PIX/PDQ\n\n    \n\n\nNo documento essa regras são definidas na RN002. Informação do “Nome do Usuário”. Nem todas as regras do manual são implementadas no PEC.\n\n1. Regras aplicadas\n\n1.  A informação deve conter pelo menos três caracteres;\n\n2.  A informação que contiver um único termo, não entrará na base de dados (Ex: JOAQUIM);\n\n3.  A informação não deve permitir a inserção de espaço duplicado;\n\n4.  A informação deve ser padronizada para letra maiúscula, ou seja, letras minúsculas deverão ser convertidas para maiúsculas (Ex: Maria da Paz é convertida para MARIA DA PAZ);\n\n5.  A informação só pode conter letras do alfabeto romano (incluindo K, W, Y), além dos acentos gráficos (agudo, circunflexo, til e trema) e do caractere apóstrofo (‘), para possibilitar a inserção de nomes como JOÃO D’ÁVILA, sendo vedada a utilização de outros caracteres especiais;\n\n6.  A informação que contiver o primeiro e segundo termos com apenas um caractere em cada um deles não entrará na base de dados (Ex. A A DA SILVA);\n\n7.  A informação que contiver apenas dois termos, ambos com apenas dois caracteres, não entrará na base de dados;\n\nAs outras regras da especificação que não são citadas acima, serão validadas apenas pelo serviço do CADSUS, no módulo de cidadão, no momento em que o cadastro for enviado ao serviço PIX do CADSUS.\n",
          "url": "/ledi/documentacao/regras/validar_nome.html"
        }
        
      , 
    
      
