        "ledi-index": {
          "title" : "Layout e-SUS AB de Dados e Interface",
          "content": "Este documento descreve os atributos utilizados no LEDI AB:\n\n\nO LEDI AB é uma camada abstrata que especifica as informações, e seus formatos, que são aceitos no envio de dados de sistemas próprios para o e-SUS AB (PEC);\nO LEDI AB pode ser implementado utilizando XML ou Apache Thrift.\n\n\n\n\nClique nos cards para acessar a documentação da versão desejada:\n\n\n    \n        \n            LEDI AB 2.0.0\n        \n        \n            LEDI AB 2.1.0\n        \n        \n            LEDI AB 2.1.1\n        \n        \n            LEDI AB 2.2.0\n        \n    \n    \n        \n            LEDI AB 3.0.0\n        \n        \n            LEDI AB 3.0.1\n        \n        \n            LEDI AB 3.2.1\n        \n    \n\n",
          "url": "/ledi/index.html"
        }
        
      
    
