        "dw-index": {
          "title" : "Data Warehouse Relatórios e-SUS AB PEC",
          "content": "Esta seção descreve a estrutura de Data Warehouse (DW) onde são armazenados os dados para a geração dos relatórios.\n\nO DW é uma base de dados contendo vários componentes. Possui uma arquitetura multidimensional, onde encontram-se as Dimensões e Fatos. Estas estruturas são alguns dos elementos do DW, são dependentes entre si e permitem o armazenamento dos dados.\n\nAtravés de um sistema de ETL, as informações são extraídas de arquivos conforme descritos na estrutura Layout e-SUS AB de Dados e Interface e armazenadas nas tabelas Fatos e Dimensões.\n\nAs Dimensões possuem características descritivas dentro do DW. São responsáveis por qualificar as informações provenientes das tabelas Fatos. As tabelas Fatos possuem características quantitativa dentro do DW. A partir delas, são extraídas métricas que são cruzadas com os dados das Dimensões, gerando informações significativas para a avaliação do usuário. Todos os dados históricos no DW ficam armazenadas nas tabelas Fatos.\n\nCom exceção dos relatórios Operacionais, todos os outros modelos de relatórios do e-SUS AB PEC utilizam esta estrutura de Data Warehouse.\n",
          "url": "/dw/index.html"
        }
        
      
    
    
  
